import "./Events.css";
const Events = () => {
    return (
        <> 
            <div className="EventBased container">
                <div className="content">
                    <h6>Our Events</h6>
                </div>

                <div className="row">

                <div className="col-sm-3">
                    <div className="box">
                        <h6>Parents Night Out</h6>
                        <p>
                            Come Out and have fun on this Kids Free Friday! We will have our weekly event at the Bowling Alley as we bowl for three hours and play arcades game. Mix and mingle with our couples and laugh and have fun. 
                        </p>
                        </div>
                        </div>    




                </div>
            </div>
        </>
    );
};

export default Events;
